samples_ae = [psnr_ae, mae_ae, ssim_ae, ms_ssim_ae]
samples_cgan = [psnr_cgan, mae_cgan, ssim_cgan, ms_ssim_cgan]
metrics = ["psnr", "mae", "ssim", "ms-ssim"]

def sample_size_power80(samples_ae,samples_cgan, metrics):
    for i, metric in enumerate(metrics):
            # Sample 1 - ae
            sample_1 = samples_ae[i]
            
            # Sample 2 - cgan
            sample_2 = samples_cgan[i]
            
            # Values set by experimenter
            #
            # Sampling ratio,  = n_1 / n_2
            kappa = 1
            # Type I error rate, 
            alpha = 0.05
            # Type II error rate, 
            beta = 0.20

            #
            # Calculate theta
            #
            # Sample size of group 1
            n_1 = len(sample_1)
            # Sample size of group 2
            n_2 = len(sample_2)
            # Mean of group 1, _1
            mu_1 = np.mean(sample_1)
            # Mean of group 2, _2
            mu_2 = np.mean(sample_2)
            # Difference of means, 
            epsilon = mu_2 - mu_1
            # Pooled sample standard deviation
            s = np.sqrt(
                (
                    np.sum((np.array(sample_1) - mu_1)**2) +
                    np.sum((np.array(sample_2) - mu_2)**2)
                ) / (n_1 + n_2 - 2)
            )
            theta = abs(epsilon) / s

            #
            # Solve for n_2
            #
            # Iterate over potential sample sizes for the smaller group
            for n in range(1000):
                # Degrees of freedom
                dof = n + n - 2
                # t-statistic
                t = st.t.ppf(1 - (alpha / 2), dof)
                # Non-centrality parameter
                nc = (np.sqrt(n) * theta) / np.sqrt(1 + 1 / kappa)
                # Cumulative distribution
                p = st.nct.cdf(t, dof, nc)
                # Test if the probability is less than or equal to the Type II error rate
                if p <= beta:
                    break
            n_2 = n
            n_1 = kappa * n

            print(metric)
            print(f'The sample sizes must be {n_1} and {n_2}')
            
            
sample_size_power80(samples_ae, samples_cgan, metrics)
